import React  from "react";
import './skills.css';
import 'font-awesome/css/font-awesome.min.css';

const Skills = () => {
    const details = require("../details/skills.json");
    return (
    <> 
        <h1>          
            <i className="fa fa-wrench "></i>
            <a> Skills </a>
        </h1>
        {
            Object.entries(details).map((key, values) =>
            <div class="child">
                <tag>[{key}]</tag>
                <ul>
                    <li>{values}</li>
                </ul>
            </div>)
        }
    </>)
}

export default Skills;
